import React, { Component } from 'react';
import work from "./../img/svg/work.svg"

export default class Work extends Component {
    render() {
        return (
         <div class="work">
            <div class="row">
                <div class="col-md-6 work-section-1">
                <img src={work} alt=""/>
                </div>
                <div class="col-md-6 work-section-2">
                  <h3 class="text-center">Projects</h3>
                    <h5><strong>Site Title</strong></h5>
                    <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Veritatis neque, eligendi optio quidem consectetur ut?</p>
                    <h5><strong>Site Title</strong></h5>
                    <p class="list">Lorem ipsum dolor sit amet consectetur, adipisicing elit. Veritatis neque, eligendi optio quidem consectetur ut?</p>








        </div>
            </div>
         </div>
        )
    }
}
